@matherinep @openupresources And that is a math thread, from your student‚Äôs question all the way to an unsolved problem!

I really enjoyed following this trail. Let me know if you‚Äôd want to connect. I‚Äôm happy to try to answer any follow-up questions, or to Zoom with you or your class!

(17/17)

@matherinep @openupresources While the Schmitt‚ÄìConway‚ÄìDanzer biprism solves the einstein problem in 3D, the einstein problem in 2D is an unsolved math problem.

The Penrose tiles are two tiles, to solve the 2D einstein problem you‚Äôd need to get it down to just one tile that can only tile irregularly.

(15/n)

@matherinep @openupresources In 2D, there is a famous *pair* of tiles called the Penrose tiles. These can together tile the plane, but cannot do so in any regular way.

https://t.co/tbUu4NviSq

(14/n) https://t.co/Zh0ZoWvhh3

@matherinep @openupresources The problem of finding such a shape (in 2D or 3D or even higher dimensions) is called the einstein problem. (Not named for Albert Einstein or any other person, it‚Äôs just a pun in German, apparantly üòÑ.)

https://t.co/Tw5UjfMci6

(13/n) https://t.co/XV3W1HDAlp

@matherinep @openupresources It‚Äôs not hard to imagine what happened: the authors of this open source online textbook grabbed some public domain images of polyhedra from Wikipedia, and this one happened to pop up.

But how cool! This particular irregular gyrobifastigium has a *very* special property.

(11/n)

@matherinep @openupresources Johnson also came up with a naming scheme for these shapes. The regular version of your shape has the name‚Ä¶

&lt;drumroll&gt;

‚Ä¶the gyrobifastigium!

https://t.co/WU3xqB5nFw

And so one answer to your question is that your shape is an irregular gyrobifastigium.

(9/n) https://t.co/KAGyfAm5HV

@matherinep @openupresources What shapes do you get? These were fully classified *much* more recently. In 1966 Norman Johnson produced a list of 92 such shapes, in addition to the Platonic and Archimedean solids, and all of the regular prisms and antiprisms.

https://t.co/5zXgvD42eq

(7/n) https://t.co/mGu6DfBFX6

@matherinep @openupresources The ‚Äúmost regular‚Äù‚Äîthe most symmetric‚Äîpolyhedra that can be made out of regular polygon faces are the Platonic solids. These have been known since ancient Greece.

https://t.co/TNqKpHj4Pj

(4/n) https://t.co/E9CPAjUmto

@matherinep @openupresources that make the faces of the two prisms aren‚Äôt equilateral triangles and squares.

But you could make the same shape but where the faces *were* equilateral triangles and squares. And when you do that, the result is an example of a Johnson solid.

(3/n)

@jeremydstewart gets covered, and for every percentage of confidence, there‚Äôs a number of people that you‚Äôd need.

So to come back to your original question: if you name the percentage of confidence you want, we can figure out how many people you would need.

Let me know!

@jeremydstewart If you have 1000 people, there‚Äôs a better chance that every day gets covered.

And if you have 1 billion people, there is an *extrememly good* chance that every day gets covered. Practically 100%.

For every number of people, there‚Äôs a percentage chance that every day +

@jeremydstewart Hi! So the more people you have, the more likely it is that every day of the year gets covered.

If you have 3 people, there‚Äôs a 0% chance that every day gets covered.

If you have 365 people, there is a *very small* chance that every day gets covered. +

